import { Text } from '../../ui';
import { StyledFooter, StyledLogo, StyledNav, Address } from './styles';

interface IFooterProps {
}

const Footer: React.FC<IFooterProps> = props => {
  return (
    <StyledFooter>
      <StyledLogo light />
      <StyledNav light />
      <Address>
        <Text>fjj</Text>
      </Address>
    </StyledFooter>
  )
};

export default Footer;
